import React from 'react'


export default function FoodText() {


    return (
        <div className='food-text'>
           <p className='food-text'>Peking Duck is probably the most famous Beijing dish. The Duck is roasted as a whole. The skin tastes crispy and the meat inside is tender. When eating, the duck is cut into slices, wrapped in lotus-leaf-like pancake with sliced scallion, sliced cucumber and sweet flour paste.</p>
        </div>
    )
}
